    false,nt"url": null,nt"notes": "This Light Detection and Ranging (LiDAR)
    classified (ASPRS LAS classifications) dataset is a topographic survey conducted
    for the Task Order 007 Aerial Survey 2010 project. This data was produced for the
    US Army Corps of Engineers (USACE) Joint Airborne Lidar Bathymetry Technical Center
    of Expertise (JALBTCX). The LiDAR point cloud was flown at a density sufficient
    to support a maximum final post spacing of 1 point per meter. 3001 International
    Inc. acquired flightlines between April 9 - 26, 2010. The Task Order 007 Aerial
    Survey 2010 was collected under the guidance of a Professional Mapper/Surveyor.
    The area of coverage includes portions of the coastline of Louisiana in the counties
    of Lafourche, Plaquemines, and Terrebonne, and along the south coast of Lake Pontchartrain
    in Jefferson and St. Charles counties. The area of coverage for Mississippi includes
    the barrier islands in Harrison and Jackson counties.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
